exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`http://www.duqu.net/html/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{recordRegex:/<div class="volume">\s*\S+ (?<volume>[^<]+)<\/div>|<a href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)},preprocess:raw=>raw.substring(raw.indexOf("<div class=\"index\">"),raw.lastIndexOf("<div id=\"tuijian\">"))})};